import React, {Component} from 'react';
import classes from "./Authorization.module.css"
import Footer from "../../components/Footer/Footer";
import Header from "../../components/Header/Header";
import {Link} from "react-router-dom";
import auth from "../../images/auth.svg";
import mobile from "../../images/mobileApp.svg"

class Authorization extends Component {
    render() {
        return (
            <div className={classes.Window}>
                <Header>
                    <Link to={"/chooseRegistration"}> <button className={classes.Button}>Зарегистрироваться</button></Link>
                    <Link to={"/"}><button className={classes.Button2}>На главную страницу</button></Link>
                </Header>
                <div className={classes.Content}>
                    <div className={classes.Container}>
                        <img className={classes.authImg} src={auth} alt={"Картинка"} ></img>
                        <img className={classes.mobileImg} src={mobile} alt={"Картинка"} ></img>
                    </div>
                </div>
                <Footer/>
            </div>
        );
    }
}

export default Authorization;
